import './Dashboard.css';

export const Dashboard = async ({supabase, session}) => {
    console.log("test")
    console.log(session)
    console.log(session.user.email)
    console.log(session.user.id)
    // Access the user's ID from the session
    const userId = session.user.id;
    console.log(userId)

    try {
        // Query the public.users table to get the gender of the user
        const query = {
          text: 'SELECT gender FROM public.users WHERE id = $1',
          values: [userId],
        };

        const result = await pool.query(query);

        if (result.rowCount > 0) {
          const userGender = result.rows[0].gender;
          console.log('User Gender:', userGender);
        } else {
          console.log('User not found in the public.users table');
        }
      } catch (error) {
        console.error('Error fetching user data:', error);
      }




    return (
        <div className='dashboard'>
            <h1>Welcome {session.user.email}</h1>

            <button onClick={() => supabase.auth.signOut()}>Sign Out</button>
        </div>
    );
}
